    {

        {
            height: 100vh;
            background-image: url(${cover});
            background-size: background-size;
            background-position: center center;
        }

        h1 {
            font-family: "Roboto Slab";
        }
    }
`;

function Home() {

    return (
        <Styles id="home">
        {/* <img src={cover} /> */}
            <h1>Common Sense</h1>
            <p>Find everyone's answer to your questions</p>
            <NavLink to="/questions">Start</NavLink>
        </Styles>
    );
};

export default Home;
